import  React,{ useEffect, useState} from 'react';
import { Container , Grid, TextField, Typography } from '@material-ui/core';
import { DataGrid } from '@material-ui/data-grid';
import { GetRequestsDocuments } from '../../services/api/Demandservice';

const columns = [
    { field: 'id', headerName: 'Nº', width: 400, editable: true },
    { field: 'Categoria', headerName: 'Categoria', width: 400, editable: true },
    { field: 'FEmision', headerName: 'Emisión', width: 400, editable: true },
    { field: 'NameClient', headerName: 'Cliente', width: 400, editable: true },
    { field: 'RUCClient', headerName: 'RUC', width: 400, editable: true },
    { field: 'UserAssing', headerName: 'Responsable', width: 400, editable: true },

  ];



const ListDemand = ()=>{

  const [ rows , setRows] = useState([]);

  useEffect(() => {
    GetRequestsDocuments().then(response =>{    
        console.log(response.data);  
        setRows(response.data);
    });
  }, [])

    return(
        <Container>
            <Grid container spacing={2} style={{marginTop:30}}>
            <Grid item md={12} justify="center" alignItems="center">
              <Typography variant="h4">Solicitudes Realizadas </Typography>

            </Grid>
              <Grid item md={3}>
              <TextField fullWidth id="outlined-basic" label="RUC" variant="outlined" />
            </Grid>
            <Grid item md={3}>
            <TextField fullWidth id="outlined-basic" label="Nombre" variant="outlined" />
            </Grid>
            <Grid item md={3}>
            <TextField fullWidth id="outlined-basic" label="Fecha" variant="outlined" />
            </Grid>
            <Grid item md={3}>
            <TextField fullWidth id="outlined-basic" label="Estado" variant="outlined" />

            </Grid>
            <div style={{ height: 400, width: '100%',marginTop:20 }}>

                    <DataGrid 
                        rows={rows}
                        columns={columns}
                        isCellEditable={(params) => params.row.age > 0}
                    />
                </div>
            </Grid>
        </Container>
    );
}

export default ListDemand;
